      <div className="itemCategory">{props.category}</div>
        {props.isAddToCartButton ? <div>Tõene</div> : <div>Väär</div>}
      <div className="isAddToCart">{props.isAddToCartButton.toString()}</div>
    </div>
  )
}

export default Item;
